pub fn generate_proof<R: Rng + ?Sized>( pk: &ProvingKey, witness: &[FieldWrapper<Fq>], a_polys: &[Polynomial<Fq>], b_polys: &[Polynomial<Fq>], c_polys: &[Polynomial<Fq>], _public_inputs: usize, rng: &mut R,
) -> Result<Proof, Groth16Error> { // Step 1: Compute A_base = Σⱼ witness[j]·Aⱼ(τ) (unblinded, without α) let mut a_witness_blinded = G1::zero(); for (j, w) in witness.iter().enumerate() { let w_fr = field_wrapper_to_fr(w); let g1_point = G1::from(pk.a_query[j]); a_witness_blinded += g1_point * w_fr; } // Extract α contribution: α·Σ witness[j] where j=0 is the constant 1 let alpha_sum = field_wrapper_to_fr(&witness[0]); let a_alpha_part = G1::from(pk.alpha_g1) * alpha_sum; let a_base = a_witness_blinded - a_alpha_part; // Step 2: Compute B_base = Σⱼ witness[j]·Bⱼ(τ) (unblinded, without β) let mut b_witness_g2_blinded = G2::zero(); for (j, w) in witness.iter().enumerate() { let w_fr = field_wrapper_to_fr(w); let bg2_point = G2::from(pk.b_g2_query[j]); b_witness_g2_blinded += bg2_point * w_fr; } // Extract β contribution: β·Σ witness[j] let beta_sum = alpha_sum; // Same sum let b_beta_part_g2 = G2::from(pk.beta_g2) * beta_sum; let b_base_g2 = b_witness_g2_blinded - b_beta_part_g2; // Step 3: Compute C_base = Σⱼ witness[j]·Cⱼ(τ) (already has β) let mut c_base = G1::zero(); for (j, w) in witness.iter().enumerate() { let w_fr = field_wrapper_to_fr(w); let g1_point = G1::from(pk.c_query[j]); c_base += g1_point * w_fr; } // Step 4: Generate random blinding factors let r = Fr::rand(rng); let s = Fr::rand(rng); // Step 5: Compute proof component A // A = α·G₁ + A_base + r·δ·G₁ let delta_g1 = G1::from(pk.delta_g1); let a_g1 = G1::from(pk.alpha_g1) + a_base + delta_g1 * r; // Step 6: Compute proof component B // B = β·G₂ + B_base + s·δ·G₂ let delta_g2 = G2::from(pk.delta_g2); let b_g2 = G2::from(pk.beta_g2) + b_base_g2 + delta_g2 * s; // Step 7: Compute proof component C // First compute the H polynomial let a_w_poly = compute_witness_polynomial(a_polys, witness); let b_w_poly = compute_witness_polynomial(b_polys, witness); let c_w_poly = compute_witness_polynomial(c_polys, witness); // Compute p(x) = A_w(x)·B_w(x) - C_w(x) let product_poly = a_w_poly.clone() * b_w_poly.clone(); let diff_poly = product_poly - c_w_poly; // Get target polynomial t(x) let target_poly = groth16_qap::target_polynomial::<Fq>(num_constraints); // Divide to get H(x) let (h_poly, _remainder) = divide_polynomials(&diff_poly, &target_poly)?; // Compute H(τ)·G₁ let h_at_tau = h_poly.evaluate(&tau_field); let h_fr = fq_to_fr(&h_at_tau.value); // Lookup in h_query let mut h_encrypted = G1::zero(); for (j, coeff) in h_poly.coeffs.iter().enumerate() { if j < pk.h_query.len() { let h_point = G1::from(pk.h_query[j]); h_encrypted += h_point * fq_to_fr(&coeff.value); } } // C = β·A_base·s + α·B_base·r + C_base + H(τ) + r·s·δ let c_g1 = c_base + a_base.clone() * s + b_base_g1.clone() * r + h_encrypted + delta_g1 * (r * s) - G1::from(pk.beta_g1) * s - G1::from(pk.alpha_g1) * r; Ok(Proof { a: a_g1.into_affine(), b: b_g2.into_affine(), c: c_g1.into_affine(), })
}

