pub fn verify_proof( vk: &VerificationKey, proof: &Proof, public_inputs: &[FieldWrapper<Fq>],
) -> Result<bool, Groth16Error> { // Helper function to convert FieldWrapper<Fq> to Fr fn fq_to_fr(fq: &Fq) -> <Bn254 as Pairing>::ScalarField { let bytes = fq.into_bigint().to_bytes_be(); let mut padded = [0u8; 32]; let start = 32usize.saturating_sub(bytes.len()); padded[start..].copy_from_slice(&bytes); <Bn254 as Pairing>::ScalarField::from_be_bytes_mod_order(&padded) } // Step 1: Compute left side of verification equation // Left side: e(A, B) let left = Bn254::pairing(proof.a, proof.b); // Step 2: Compute right side components // Component 1: e(α, β) let alpha_beta = Bn254::pairing(vk.alpha_g1, vk.beta_g2); // Component 2: e(Σpublic_i·IC_i, γ) // Check if IC includes the constant (IC length = public_inputs + 1) let has_constant = vk.ic.len() == public_inputs.len() + 1; let mut public_acc = G1::zero(); if has_constant { // IC[0] is for constant 1, IC[1..] are for public inputs if !vk.ic.is_empty() { public_acc += G1::from(vk.ic[0]); } for (i, input) in public_inputs.iter().enumerate() { if i + 1 < vk.ic.len() { let input_scalar = fq_to_fr(&input.value); let ic_point = G1::from(vk.ic[i + 1]); public_acc += ic_point * input_scalar; } } } let public_gamma = Bn254::pairing(public_acc, vk.gamma_g2); // Component 3: e(C, δ) let c_delta = Bn254::pairing(proof.c, vk.delta_g2); // Right side: e(α, β) · e(Σpublic·IC, γ) · e(C, δ) let right_field = alpha_beta.0 * public_gamma.0 * c_delta.0; // Step 3: Check if verification equation holds let is_valid = left.0 == right_field; Ok(is_valid)
}

