///
/// Instead of O(n) pairing operations for n proofs, we use O(1) pairings total.
pub fn batch_verify<R: Rng>( vk: &VerificationKey, proofs: &[Proof], public_inputs_list: &[Vec<FieldWrapper<Fq>>], rng: &mut R,
) -> Result<bool, Groth16Error>
{ // Generate random coefficients for each proof let mut coeffs = Vec::with_capacity(proofs.len()); for _ in 0..proofs.len() { let r = Fr::rand(rng); coeffs.push(r); } // Compute combined left side: e(Σ rᵢ·Aᵢ, Bᵢ) let mut combined_a = G1::zero(); for (i, proof) in proofs.iter().enumerate() { combined_a += G1::from(proof.a) * coeffs[i]; } let left = Bn254::pairing(combined_a, proofs[0].b); // Compute combined right side // ... (similar combination for right side) // Single pairing check for all proofs Ok(left.0 == right.0)
} Speedup : For n proofs: Individual: ~3n pairings Batch: ~3 pairings (constant!) Speedup: Approximately n× faster

