/// Aⱼ(i) = coefficient of variable j in A vector of constraint i
pub fn r1cs_to_qap<F>( constraints: &[R1CSConstraint<F>], num_variables: usize,
) -> Result<QapPolynomials<F>, QapError>
where F: PrimeField,
{ let n = constraints.len(); let mut a_polys = Vec::with_capacity(num_variables); let mut b_polys = Vec::with_capacity(num_variables); let mut c_polys = Vec::with_capacity(num_variables); for j in 0..num_variables { // Collect points for variable j across all constraints let mut a_points = Vec::with_capacity(n); let mut b_points = Vec::with_capacity(n); let mut c_points = Vec::with_capacity(n); for (i, constraint) in constraints.iter().enumerate() { let x = F::from((i + 1) as u64); // 1-based constraint index let a_coeff = constraint.a.get(&j) .cloned().unwrap_or_else(FieldWrapper::zero); let b_coeff = constraint.b.get(&j) .cloned().unwrap_or_else(FieldWrapper::zero); let c_coeff = constraint.c.get(&j) .cloned().unwrap_or_else(FieldWrapper::zero); a_points.push((x, a_coeff)); b_points.push((x, b_coeff)); c_points.push((x, c_coeff)); } // Interpolate polynomials for this variable let a_poly = lagrange_interpolate(&a_points)?; let b_poly = lagrange_interpolate(&b_points)?; let c_poly = lagrange_interpolate(&c_points)?; a_polys.push(a_poly); b_polys.push(b_poly); c_polys.push(c_poly); } Ok((a_polys, b_polys, c_polys))
} Key observations : For each variable, we collect its coefficients across all constraints We use 1-based indexing for constraint positions (x = 1, 2, ..., n) Missing coefficients default to 0 (sparse representation)

