From crates/qap/src/polynomials.rs:152-238: pub fn lagrange_interpolate<F>( points: &[(F, FieldWrapper<F>)],
) -> Result<Polynomial<F>, QapError>
where F: PrimeField,
{ let n = points.len(); // Start with zero polynomial let mut result_coeffs = vec![FieldWrapper::<F>::zero(); n]; for i in 0..n { let (xi, yi) = &points[i]; // Compute Lagrange basis polynomial Lᵢ(x) let mut li_coeffs = vec![FieldWrapper::<F>::one()]; let mut denominator = FieldWrapper::<F>::one(); for (j, xj) in points.iter().enumerate() { if i == j { continue; } // Multiply by (x - xj) let mut new_coeffs = vec![FieldWrapper::<F>::zero(); li_coeffs.len() + 1]; for (k, coeff) in li_coeffs.iter().enumerate() { new_coeffs[k + 1] += coeff.clone(); // x * coeff new_coeffs[k] -= coeff.clone() * FieldWrapper::<F>::from(xj.0); // -xj * coeff } li_coeffs = new_coeffs; // Multiply denominator by (xi - xj) denominator = denominator * (FieldWrapper::<F>::from(*xi) - FieldWrapper::<F>::from(xj.0)); } // Scale by yi / denominator let inv_denominator = FieldWrapper::<F>::from(denominator.value.inverse().unwrap()); let scalar = yi.clone() * inv_denominator; // Add scaled Lᵢ(x) to result for (k, coeff) in li_coeffs.iter().enumerate() { if k < result_coeffs.len() { result_coeffs[k] += coeff.clone() * scalar.clone(); } } } Ok(Polynomial::new(result_coeffs))
}

