pub fn check_divisibility<F>( witness: &[FieldWrapper<F>], a_polynomials: &[Polynomial<F>], b_polynomials: &[Polynomial<F>], c_polynomials: &[Polynomial<F>], target: &Polynomial<F>,
) -> Result<bool, QapError>
where F: PrimeField,
{ // Compute a(x) = Σⱼ witness[j] · Aⱼ(x) let mut a = Polynomial::<F>::new(vec![FieldWrapper::zero()]); for (j, poly) in a_polynomials.iter().enumerate() { let scaled = scale_polynomial(poly, &witness[j]); a = a + scaled; } // Compute b(x) = Σⱼ witness[j] · Bⱼ(x) let mut b = Polynomial::<F>::new(vec![FieldWrapper::zero()]); for (j, poly) in b_polynomials.iter().enumerate() { let scaled = scale_polynomial(poly, &witness[j]); b = b + scaled; } // Compute c(x) = Σⱼ witness[j] · Cⱼ(x) let mut c = Polynomial::<F>::new(vec![FieldWrapper::zero()]); for (j, poly) in c_polynomials.iter().enumerate() { let scaled = scale_polynomial(poly, &witness[j]); c = c + scaled; } // Compute p(x) = a(x) · b(x) - c(x) let ab = a.clone() * b.clone(); let p = ab - c; // Check if p(x) is divisible by t(x) let (_quotient, remainder) = polynomial_long_division(&p, target)?; // Witness is valid iff remainder is zero Ok(remainder.is_zero())
}

